import React, {useState, useEffect} from 'react';
import { getShopItems } from "../scripts/api-scripts";


function Shop(props){
    const [items, setItems] = useState([]);

    const change = async() => {
        let temp = await getShopItems();
        setItems(temp);
    };

    return (<div className="ShopContent">
        {items && items.map((item) => <p key={item._id}>
            {item.name}</p>)}
    </div>);
};

export default Shop;
